const result = await exa.web_search_exa(
  {"query": "rust mcp"}
);
return result;

const results = await exa.web_search_exa(
  {"query": "rust async"}
);
const urls = results.results.map(r => r.url);
const details = [];
for (const url of urls.slice(0, 3)) {
  details.push(
    await exa.get_contents({ids: [url]})
  );
}
return {results, details};
